  `KEY` varchar(36) COLLATE utf8mb4_bin NOT NULL COMMENT '「key」- 资产主键',
  `NAME` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「name」- 资产名称',
