CREATE TABLE `L_COUNTRY` (
  `KEY` varchar(36) COLLATE utf8mb4_bin NOT NULL COMMENT '「key」- 国家主键',
  `NAME` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '「name」- 国家名称',
  `CODE` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「code」- 国家编号',
  `FLAG` varchar(8) COLLATE utf8mb4_bin NOT NULL COMMENT '「flag」- 国旗',
