  `CURRENCY` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「currency」- 使用货币',
  `METADATA` text COLLATE utf8mb4_bin COMMENT '「metadata」- 附加配置',
  `ORDER` int(11) DEFAULT NULL COMMENT '「order」- 排序',
  `ACTIVE` bit(1) DEFAULT NULL COMMENT '「active」- 是否启用',
  `SIGMA` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「sigma」- 统一标识',
  `LANGUAGE` varchar(8) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「language」- 使用的语言',
  `CREATED_AT` datetime DEFAULT NULL COMMENT '「createdAt」- 创建时间',
  `CREATED_BY` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「createdBy」- 创建人',
  `UPDATED_AT` datetime DEFAULT NULL COMMENT '「updatedAt」- 更新时间',
  `UPDATED_BY` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「updatedBy」- 更新人',
  PRIMARY KEY (`KEY`),
  UNIQUE KEY `CODE` (`CODE`,`SIGMA`),
