-- Table structure for table `S_GROUP`
--

DROP TABLE IF EXISTS `S_GROUP`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `S_GROUP` (
  `KEY` varchar(36) COLLATE utf8mb4_bin NOT NULL COMMENT '「key」- 组ID',
  `NAME` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「name」- 组名称',
  `CODE` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「code」- 组系统码',
  `PARENT_ID` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「parentId」- 父组ID（组支持树形结构，角色平行结构）',
  `MODEL_ID` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「modelId」- 组所关联的模型identifier，用于描述',
  `MODEL_KEY` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「modelKey」- 组所关联的模型记录ID，用于描述哪一个Model中的记录',
  `CATEGORY` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「category」- 组类型',
  `SIGMA` varchar(128) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「sigma」- 用户组绑定的统一标识',
  `LANGUAGE` varchar(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「language」- 使用的语言',
  `ACTIVE` bit(1) DEFAULT NULL COMMENT '「active」- 是否启用',
  `METADATA` text COLLATE utf8mb4_bin COMMENT '「metadata」- 附加配置数据',
  `CREATED_AT` datetime DEFAULT NULL COMMENT '「createdAt」- 创建时间',
  `CREATED_BY` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「createdBy」- 创建人',
  `UPDATED_AT` datetime DEFAULT NULL COMMENT '「updatedAt」- 更新时间',
  `UPDATED_BY` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「updatedBy」- 更新人',
  PRIMARY KEY (`KEY`) USING BTREE,
  UNIQUE KEY `CODE` (`CODE`,`SIGMA`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;
/*!40101 SET character_set_client = @saved_cs_client */;

