CREATE TABLE `S_PATH` (
  `KEY` varchar(36) COLLATE utf8mb4_bin NOT NULL COMMENT '「key」- 规则主键',
  `NAME` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「name」- 规则名称',
  `CODE` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「code」- 系统界面标识',
  `GROUP_MAPPING` text COLLATE utf8mb4_bin COMMENT '「mapping」- 从 group -> ui 转换',
  `GROUP_TYPE` varchar(128) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「groupType」- 分组类型',
  `GROUP_COMPONENT` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「groupComponent」- 必须绑定组专用Dao组件',
  `GROUP_CONDITION` text COLLATE utf8mb4_bin COMMENT '「groupCondition」- 分组条件',
  `GROUP_CONFIG` text COLLATE utf8mb4_bin COMMENT '「groupConfig」- 组配置信息，配置呈现部分',
  `UI_TYPE` text COLLATE utf8mb4_bin COMMENT '「uiType」- 目标数据源类型',
  `UI_CONFIG` text COLLATE utf8mb4_bin COMMENT '「uiConfig」- 界面配置',
  `UI_CONDITION` text COLLATE utf8mb4_bin COMMENT '「uiCondition」- 查询模板',
  `UI_COMPONENT` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「uiComponent」- 在 DAO/OX/DEF 时的特殊组件',
  `SIGMA` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「sigma」- 统一标识',
