DROP TABLE IF EXISTS `S_RESOURCE`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `S_RESOURCE` (
  `KEY` varchar(36) COLLATE utf8mb4_bin NOT NULL COMMENT '「key」- 资源对应的ID',
  `CODE` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「code」- 资源编号',
  `NAME` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「name」- 资源名称',
  `TYPE` varchar(60) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「type」- 资源分类',
  `IDENTIFIER` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「identifier」- 当前资源所属的Model的标识',
  `COMMENT` text COLLATE utf8mb4_bin COMMENT '「comment」- 备注信息',
  `LEVEL` int(11) DEFAULT NULL COMMENT '「level」- 资源需求级别',
  `MODE_ROLE` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「modeRole」- 该资源查找角色的模式',
  `MODE_GROUP` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「modeGroup」- 该资源查找组的模式',
  `MODE_TREE` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「modeTree」- 该资源处理树（用户组）的模式',
  `VIRTUAL` bit(1) DEFAULT NULL COMMENT '「virtual」- 虚拟资源',
  `SEEK_SYNTAX` text COLLATE utf8mb4_bin COMMENT '「seekSyntax」- 访问者语法',
  `SEEK_CONFIG` text COLLATE utf8mb4_bin COMMENT '「seekConfig」- 访问者配置',
  `SEEK_COMPONENT` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「seekComponent」- 访问者组件',
  `SIGMA` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「sigma」- 统一标识',
  `CATEGORY` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「category」- 资源分类',
  `LANGUAGE` varchar(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「language」- 使用的语言',
  `ACTIVE` bit(1) DEFAULT NULL COMMENT '「active」- 是否启用',
  `METADATA` text COLLATE utf8mb4_bin COMMENT '「metadata」- 附加配置数据',
  `CREATED_AT` datetime DEFAULT NULL COMMENT '「createdAt」- 创建时间',
  `CREATED_BY` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「createdBy」- 创建人',
  `UPDATED_AT` datetime DEFAULT NULL COMMENT '「updatedAt」- 更新时间',
  `UPDATED_BY` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '「updatedBy」- 更新人',
  PRIMARY KEY (`KEY`) USING BTREE,
  UNIQUE KEY `CODE` (`CODE`,`SIGMA`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;
/*!40101 SET character_set_client = @saved_cs_client */;

